import React, { Component } from 'react'
import './Mycss.css';
import {Link} from 'react-router-dom';

export default class Navbar extends Component {
    render() {
        return (
            <div>
            <div className="MainClass">
                <div className="lists">
                <ul><li><a>ABOUT US </a></li></ul>
                <ul><li><a>CONTENTS</a></li></ul>
                <ul><li><a>CONTACT US</a></li></ul>
                <ul><li><a>MOTTO</a></li></ul>
                <ul><li><a>LIFE</a></li></ul>
                </div>
                <div className="lists">
                <ul><li><Link to="/form">Login</Link></li></ul>
                <ul><li><a>SIGN UP</a></li></ul>
                </div>


                </div>
            </div>
        )
    }
}
